import React, { Component } from "react";
import Lists from './Lists';

export default class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            listItems: [
                {
                    description: 'I item',
                    status: true
                },
                {
                    description: 'I second item',
                    status: false
                }
            ]
        };
    }

    render() {
        return (
            <div>
                <Lists
                    items={this.state.listItems} />
            </div>
        );
    }
};
